import React from 'react';
import { useTranslation } from 'react-i18next'; // Импортируем useTranslation
import i18n from "../i18next";
import LanguageSwitcher from "../../LanguageSwitcher";
import '../../Style/rus/Index__rus.scss'; // Или другой корректный путь
import AOS from 'aos';
import 'aos/dist/aos.css'; // Подключение стилей, если необходимо


function Header__eng() {
    const { t } = useTranslation(); // Получаем функцию t для перевода текстов
    AOS.init();

    const changeLanguage = (language) => {
        i18n.changeLanguage(language);
    };

    return (
        <>
            <header>
                <nav>
                    <div className="nav__item">
                        <p><a href="#">JT</a></p>

                        <div className="launges">
                            <LanguageSwitcher/>
                        </div>
                    </div>
                </nav>

                <div className="header__item">
                    
                    <h1>{t('header.title')}</h1> {/* Пример перевода заголовка */}
                    <div className="text1">
                        <div className="circle"></div>
                        <h2>{t('header.text1')}</h2> {/* Пример перевода текста 1 */}
                    </div>

                    <div className="text2">
                        <div className="circle"></div>
                        <h2>{t('header.text2')}</h2> {/* Пример перевода текста 2 */}
                    </div>

                    <div className="text3">
                        <div className="circle"></div>
                        <h2>{t('header.text3')}</h2> {/* Пример перевода текста 3 */}
                    </div>
                </div>

                <div className="contacts__ico">
                    <div className="telegram">
                        <a href="https://t.me/joha_17"><img src="./imgs/icons/telegram.png" alt="Telegram"/></a>
                    </div>

                    <div className="instagram">
                        <a href="https://www.instagram.com/jaavooh"><img src="./imgs/icons/Instagram.png" alt="Instagram"/></a>
                    </div>
                </div>

                <img className="oblako1" src="./imgs/oblaka1.png" alt=""/>
                <img data-aos="fade-down" data-aos-duration="1500" className="oblako2" src="./imgs/oblaka2.png" alt=""/>
                <img data-aos="fade-left" data-aos-duration="2000" className="programmer" src="./imgs/programmer.png" alt=""/>
                <img className="pc" src="./imgs/pc.png" alt=""/>
                <img className="Code1" src="./imgs/Code1.png" alt=""/>
                <img className="Code2" src="./imgs/Code2.png" alt=""/>
                <img data-aos="fade-up" data-aos-duration="2500" className="Mobile" src="./imgs/Mobile.png" alt=""/>
            </header>
        </>
    );
}

export default Header__eng;
